import React from "react";

class Noeuds extends React.Component {
  constructor() {
    super();
    this.state = {
      allNodes: []
    };
    this.callNoeuds = this.callNoeuds.bind(this);
  }

  callNoeuds() {
    fetch("http://localhost:9000")
      // .then(res => console.log(res))
      .then(res => res.text())
      .then(res => this.setState({ allNodes: res }))
      .then(err => err);
  }

  componentDidMount() {
    this.callNoeuds();
  }

  render() {
    console.log(this.state.allNodes);
    const NeoudsComponents = this.state.allNodes.map(item => (
      <li key={item.id}>{item.name}</li>
    ));
    // console.log(this.state.allNodes.map(item => console.log(item)));
    // const NoeudsComponents = this.state.allNodes.map(item => (
    //   <li key={item.id}>{item.name}</li>
    // ));

    return (
      <div>
        <ul>{NoeudsComponents}</ul>
      </div>
    );
  }
}

export default Noeuds;
